import React from "react";
import '../Month.css';
import Week from "./Week";
import Set from "./Set";

const Month = () => {
    return <div style={{
        padding: '50px 20px 0px 300px'
    }}>
        <Set />
        <Week />
    </div>;
};

export default Month;
